import React from 'react';
import { ReactComponent as CommunityIcon } from '../assets/icons/Vector.svg';
import { ReactComponent as AvatarIcon } from '../assets/icons/Ellipse 1.svg';
import avatarImage from '../assets/icons/2.png'; // Correct the import path

const Header = () => (
  <div className="header">
    {/* Avatar with background SVG and overlay image */}
    <div className="avatar-container">
      <AvatarIcon className="avatar-background"/>
      <img src={avatarImage} alt="Chatbot Avatar" className="avatar-image" /> // Use imported avatar image
    </div>

    {/* Community Button */}
    <button
      className="community-button"
      onClick={() => window.open('https://t.me/MrJournaler', '_blank')}
    >
      <CommunityIcon className="community-button-icon" />
      <span className="community-button-text">Go to community</span>
    </button>
  </div>
);

export default Header;
